import React from 'react';
import { useCart } from './CartContext';
import './styles/Meat.css'; // Import CSS file for styles

const Meat = () => {
  const { addToCart } = useCart();
  const meatsList = [
    { name: 'Beef', description: 'Lean protein source rich in iron and B vitamins.', image: 'https://mineblocks.com/1/wiki/images/thumb/9/9a/Raw_Beef.png/150px-Raw_Beef.png' },
    { name: 'Chicken', description: 'Versatile poultry meat with low fat content.', image: 'https://minecraft.wiki/images/thumb/Chicken_JE2_BE2.png/150px-Chicken_JE2_BE2.png?30245' },
    { name: 'Pork', description: 'Tender and flavorful meat often used in various cuisines.', image: 'https://minecraftdungeons.wiki.fextralife.com/file/Minecraft-Dungeons/pork-consumable-item-minecraft-dungeons-wiki-guide-150px.png'  },
    { name: 'Fish', description: 'Healthy seafood option high in omega-3 fatty acids.', image: 'https://www.forksoverknives.com/uploads/is-fish-healthy-150x150.jpg?auto=webp' },
    { name: 'Lamb', description: 'Tender meat with a distinct flavor, popular in Mediterranean dishes.', image: 'https://meateatingmilitaryman.com/wp-content/uploads/2023/03/minted-lamb-chops-150x150.jpg' },
  ];

  return (
    <div>
      <h1>Types of Meats</h1>
      <div className="meats-list">
        {meatsList.map((meat, index) => (
          <div key={index} className="meat-item">
            <img src={meat.image} alt={meat.name} />
            <h3>{meat.name}</h3>
            <p>{meat.description}</p>
            <button onClick={() => addToCart(meat)}>Add to Cart</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Meat;
